# --- MUD ValueType (decimal) to SQL Type Mapping ---
# This mapping is based on the mud.dev/store/encoding documentation.
MUD_TYPE_TO_SQL_DEC = {
    # uint<N> types (0 to 31)
    0: 'SMALLINT',  # uint8
    1: 'SMALLINT',  # uint16
    2: 'INTEGER',   # uint24
    3: 'INTEGER',   # uint32 (commonly used as INT)
    4: 'BIGINT',    # uint40
    5: 'BIGINT',    # uint48
    6: 'BIGINT',    # uint56
    7: 'BIGINT',    # uint64
    # For larger uints (up to uint256), use NUMERIC to preserve full precision
    **{i: 'NUMERIC(78)' for i in range(8, 32)}, # uint72 to uint256

    # int<N> types (32 to 63)
    32: 'SMALLINT',  # int8
    33: 'SMALLINT',  # int16
    34: 'INTEGER',   # int24
    35: 'INTEGER',   # int32
    39: 'BIGINT',    # int64
    # For larger ints (up to int256), use NUMERIC
    **{i: 'NUMERIC(78)' for i in range(40, 64)}, # int72 to int256

    # bytes<N> types (64 to 95) - fixed-size bytes
    # Map to BYTEA for raw binary data, or VARCHAR if you want hex strings.
    # We'll use BYTEA as it's more faithful to binary data.
    **{i: 'BYTEA' for i in range(64, 96)}, # bytes1 to bytes32

    96: 'BOOLEAN',      # bool (0x60)
    97: 'VARCHAR(42)',  # address (0x61) - 0x prefix + 40 hex chars = 42 characters

    # Array types (98 to 193 for primitive arrays, then 194-195 for bool[]/address[])
    # Exact element types are complex with array schemas.
    # For simplicity and flexibility, map all arrays to JSONB (PostgreSQL) or TEXT (generic)
    # JSONB is preferred for structured data storage if your DB supports it.
    # For generic SQL, TEXT is a safe fallback.
    **{i: 'JSONB' for i in range(98, 196)}, # Covers uint[] to address[] arrays

    196: 'BYTEA',       # bytes (0xC4) - dynamic length binary data
    197: 'TEXT'         # string (0xC5) - dynamic length text data
}


# --- Define helpers ---

def decode_abi_string_array(hex_string):
    """
    Decodes an ABI-encoded hex string of `string[]` type using eth_abi.
    This is for the `abiencodedkeynames` and `abiencodedfieldnames` fields.
    """
    if not hex_string or not hex_string.startswith('0x'):
        return []
    
    data_to_decode = hex_string[2:]
    if not data_to_decode or len(data_to_decode) % 2 != 0:
        print(f"Warning: Skipping malformed hex string (empty or odd length) for ABI decode: '{hex_string}'")
        return []

    try:
        encoded_bytes = bytes.fromhex(data_to_decode)
        # eth_abi.decode(['string[]'], ...) correctly parses the ABI-encoded string array
        decoded_list = decode(['string[]'], encoded_bytes)[0]
        return decoded_list
    except ValueError as ve:
        print(f"Error: ValueError decoding ABI string array '{hex_string[:150]}...': {ve}")
        return []
    except Exception as e:
        print(f"Warning: Could not decode ABI string array '{hex_string[:150]}...': {e}")
        return []

def parse_schema_to_sql_types(schema_hex_string):
    """
    Parses a MUD schema hex string (e.g., '0x040143') into a list of corresponding SQL type names.
    This function expects the hex string to be a direct concatenation of SchemaType bytes.
    It removes trailing 0x00 padding bytes.
    """
    if not schema_hex_string or not schema_hex_string.startswith('0x'):
        return []
    
    raw_hex_data = schema_hex_string[2:]
    if not raw_hex_data or len(raw_hex_data) % 2 != 0:
        return []

    sql_types = []
    try:
        # Convert hex string to raw bytes
        schema_bytes = bytes.fromhex(raw_hex_data)
        
        # MUD schema bytes are just a sequence of SchemaType (uint8) values.
        # They might be padded with null bytes (0x00) at the end if the total length
        # of the types is less than the fixed size of the field (e.g., bytes32).
        # We strip trailing null bytes to get only the actual type definitions.
        cleaned_schema_bytes = schema_bytes.rstrip(b'\x00')

        for byte_val in cleaned_schema_bytes:
            sql_type = MUD_TYPE_TO_SQL_DEC.get(byte_val)
            if sql_type:
                sql_types.append(sql_type)
            else:
                # Fallback for unknown types - print warning and indicate unknown
                sql_types.append(f"UNKNOWN_DEC_TYPE({byte_val})")
                print(f"Warning: Unknown MUD schema type code: {byte_val} from '{schema_hex_string}'")
        
    except Exception as e:
        print(f"Error parsing schema hex '{schema_hex_string[:50]}...': {e}")
        return [f"PARSING_ERROR({schema_hex_string})"]

    return sql_types


def decode_table_id_name(table_id_hex):
    """
    Decodes the name part from a MUD ResourceId (tableid).
    """
    if not table_id_hex or not table_id_hex.startswith('0x'):
        return table_id_hex
    
    # MUD ResourceId format (bytes32): 2 bytes type + 14 bytes namespace + 16 bytes name
    # The name part is the last 16 bytes (32 hex characters)
    name_part_hex = table_id_hex[-32:]
    
    if not name_part_hex or len(name_part_hex) % 2 != 0:
        return f"MalformedTableId({table_id_hex})"

    try:
        # Decode hex to bytes, then to UTF-8, and strip null padding
        return bytes.fromhex(name_part_hex).decode('utf-8').rstrip('\x00')
    except Exception:
        return f"Undecodable({name_part_hex})"


# --- Process the response data ---
parsed_tables = []

headers = response_data['result'][0][0] 
data_rows = response_data['result'][0][1:] 

for row in data_rows:
    table_info = dict(zip(headers, row))
    
    # Decode ABI-encoded key names (e.g., 'characterId')
    if 'abiencodedkeynames' in table_info:
        table_info['abiencodedkeynames_decoded'] = decode_abi_string_array(table_info['abiencodedkeynames'])
    else:
        table_info['abiencodedkeynames_decoded'] = []

    # Decode ABI-encoded field names (e.g., 'corpIds', 'name')
    if 'abiencodedfieldnames' in table_info:
        table_info['abiencodedfieldnames_decoded'] = decode_abi_string_array(table_info['abiencodedfieldnames'])
    else:
        table_info['abiencodedfieldnames_decoded'] = []
    
    # Decode MUD schema bytes (keyschema, valueschema) to SQL types
    if 'keyschema' in table_info:
        table_info['key_schema_sql_types'] = parse_schema_to_sql_types(table_info['keyschema'])
    else:
        table_info['key_schema_sql_types'] = []
        
    if 'valueschema' in table_info:
        table_info['value_schema_sql_types'] = parse_schema_to_sql_types(table_info['valueschema'])
    else:
        table_info['value_schema_sql_types'] = []

    # Decode tableId to a more readable name part
    if 'tableid' in table_info:
        table_info['tableId_decoded_name_part'] = decode_table_id_name(table_info['tableid'])
    else:
        table_info['tableId_decoded_name_part'] = "N/A"

    parsed_tables.append(table_info)

# Pretty print the final decoded schema information
print(json.dumps(parsed_tables, indent=2))